import { Box, Flex } from '@chakra-ui/react';
import igmg_logo from './assets/igmg_logo.png'

export function MenuBar() {
    return (
      <div className="MenuBar">
        <menu>
          <img src={igmg_logo} className="App-logo" alt="logo" />
          <TabButton>
            Home
          </TabButton>
          <TabButton>
            About
          </TabButton>
        </menu>
      </div>
    );
  }
